import React from 'react';


const Person=(props)=>{
    return(
        <div className='tc bg-light-red ba fl w-25 pt2 mw0 mt0 br-4' >
            <img src= 'https://api.adorable.io/avatars/200/1.png' alt='every-day people' className='br-100'/>
            <h1>{props.name}</h1>
            <p>{props.email}</p>
            <span>
                <p>{props.street1}<br/>{props.street2}<br/>{props.street3}</p>
            </span>
        </div>
    )
}

export default Person
